    [CascadingParameter]
    private Task<AuthenticationState> authenticationStateTask { get; set; }

    protected async override Task OnInitializedAsync()
    {
        user = new Users();

        claimsPrincipal = (await authenticationStateTask).User;

        if (claimsPrincipal.Identity.IsAuthenticated)
        {
            NavigationManager.NavigateTo("/dashboard");
        }
        {
            user.EmailAddress = "b@gmail.com";
            user.Password = "0000000";
        }
        StateHasChanged();

    }

    private async Task<bool> ValidateUser()
    {
        //assume that user is valid
        //call an API

        var returnedUser = await userService.LoginAsync(user);

        if (returnedUser.EmailAddress != null)
        {
            await ((CustomAuthenticationStateProvider)AuthenticationStateProvider).MarkUserAsAuthenticated(returnedUser);

            var resultCompany = icompany.ViewCompany(returnedUser.CompanyId);
            if (resultCompany != null)
            {
                //Session
                PublicVariables.companyName = resultCompany.CompanyName;
                await sessionStorage.SetItemAsync("Email", returnedUser.EmailAddress);
                //await sessionStorage.SetItemAsync("Photo", result.Image);
                await sessionStorage.SetItemAsync("RoleId", returnedUser.Role.RoleId);
                await sessionStorage.SetItemAsync("UserId", returnedUser.UserId);
                await sessionStorage.SetItemAsync("CompanyName", resultCompany.CompanyName);
                await sessionStorage.SetItemAsync("CompanyId", resultCompany.CompanyId);
                await sessionStorage.SetItemAsync("FinancialYearId", resultCompany.FinancialYearId);
                await sessionStorage.SetItemAsync("FromDate", resultCompany.FromDate);
                await sessionStorage.SetItemAsync("ToDate", resultCompany.ToDate);
                //InsertTrackUser
                TrackUser user = new TrackUser();

                user.userName = returnedUser.EmailAddress;
                user.IP = string.Empty;
                user.Country_Code = string.Empty;
                user.Country_Name = string.Empty;
                user.Region_Code = string.Empty;
                user.Region_Name = string.Empty;
                user.City = string.Empty;
                user.Zip_Code = string.Empty;
                user.Time_Zone = string.Empty;
                user.Latitude = string.Empty;
                user.Longitude = string.Empty;
                user.Metro_Code = string.Empty;
                user.FormName = "Login";
                user.ViewName = "Login";
                user.Description = "Login";
                user.addedDate = DateTime.Now;
                authService.SaveTrackHistory(user);
            }
            NavigationManager.NavigateTo("/dashboard");
        }
        else
        {
            LoginMesssage = "Invalid username or password";
        }

        return await Task.FromResult(true);
    } 

